            if airport is None:
                airport = triple.subject
            location_info.append(f"{airport} serves {triple.object}")
        elif triple.predicate == "country":
            location_info.append(f"{triple.subject} is in {triple.object}")
        elif triple.predicate == "capital":
            location_info.append(f"The capital of {triple.subject} is {triple.object}")
        elif triple.predicate == "elevationAboveTheSeaLevel":
            location_info.append(f"{triple.subject} has an elevation of {triple.object} meters")
        elif triple.predicate == "location":
            location_info.append(f"{triple.subject} is located in {triple.object}")
        else:
            location_info.append(f"{triple.subject} {triple.predicate} {triple.object}")

    if airport:
        sentence += f"{airport} "
        sentence += " which ".join(location_info) + "."
    else:
        sentence = " and ".join(location_info) + "."

    return sentence

